  `SUG_SCORE` varchar(255) DEFAULT NULL COMMENT '建议试题总分',
  `SUG_PART_SCORE` varchar(255) DEFAULT NULL COMMENT '建议部分分',
  `USER_ID` varchar(255) DEFAULT NULL COMMENT '用户ID',
  `CREATE_DATE` varchar(255) DEFAULT NULL COMMENT '创建时间',
  `REMARK` varchar(255) DEFAULT NULL COMMENT '备注',
  `METHOD` varchar(1000) DEFAULT NULL,
  `CONTENT_IMAGE_PATH` varchar(255) DEFAULT NULL COMMENT '图片地址，试题直接以图片显示',
  `OPTION_IMAGE_PATH` varchar(255) DEFAULT NULL COMMENT '答案图片地址',
