INSERT INTO `sv_question` VALUES ('16097b6c-09a4-11e5-b1a3-c81f66fbc0b2', '0', '26', null, null, null, null, '94f9bbcc-06e6-34b6-b738-1978e2fd0043', '—Do you like Zhou Jielun or Liu Dehua?    \n<br/>— ________. I am not their fans.', '4', '[Both, Either, Neither, All]', 'C', '2', '试题分析：</code>句意：——你喜欢周杰伦还是刘德华？ ——两者都不。我不是他们的歌迷。A. both  两者都； B．either  两者中之一；C．neither  两者都不；D. all 所有的都（三者以上），由问句可知是两者，排除D，再由后面的句子可知两者都不，故选C。', '101', null, null, null, null, null, null, null, null, null);
INSERT INTO `sv_question` VALUES ('160c7c0e-09a4-11e5-b1a3-c81f66fbc0b2', '0', '26', null, null, null, null, '85ac0ed8-0889-373f-a224-f0d0b2eadf8e', '—Where is your mother, Rita?<br/> —<fill></fill>. ', '4', '[She has been to Wu hu, She\'s going to the old people\'s home, She\'s gone to work, She\'ll go shopping]', 'C', '2', '——你妈妈在哪儿？——她去了武汉。has been to曾经去过某地，已经回来；has gone to去了某地，还没有回来；be going to =\" will\" do 将来时；结合句意可知人没有回来，故选C。', '101', null, null, null, null, null, null, null, null, null);
