INSERT INTO `sv_question` VALUES ('1cec55af-9d6d-5f19-a5e2-d1767ed2e853', '0', '10', null, null, null, null, 'deeb1915-6c0e-3489-8d79-503eb7cf3175,0f5980cf-ddc1-31ea-94ce-1ba46ac77fe6,3695386b-c805-3e6a-afd9-e6eb73e6f57b,31992607-daff-3840-b193-1e796f03f554,1a565231-f23b-31e6-9f05-dd6b7356a87b', '下面说法正确有（　　）<br />（1）把一根长2米的绳子，平均截成5段，每段占全长的<span class=\"YclQues\" mathtag=\"math\" style=\"whiteSpace:nowrap;wordSpacing:normal;wordWrap:normal\"><table cellpadding=\"-1\" cellspacing=\"-1\" style=\"margin-right:1px\"><tr><td style=\"border-bottom:1px solid black\">2</td></tr><tr><td>5</td></tr></table></span>；<br />（2）公元2100年有366天；<br />（3）分数<span class=\"YclQues\" mathtag=\"math\" style=\"whiteSpace:nowrap;wordSpacing:normal;wordWrap:normal\"><table cellpadding=\"-1\" cellspacing=\"-1\" style=\"margin-right:1px\"><tr><td style=\"border-bottom:1px solid black\">b</td></tr><tr><td>a</td></tr></table></span>一定小于<span class=\"YclQues\" mathtag=\"math\" style=\"whiteSpace:nowrap;wordSpacing:normal;wordWrap:normal\"><table cellpadding=\"-1\" cellspacing=\"-1\" style=\"margin-right:1px\"><tr><td style=\"border-bottom:1px solid black\">b+m</td></tr><tr><td>a+m</td></tr></table></span>（a、b、m均为非零自然数）；<br />（4）因为1.6÷0.3=16÷3=5…1，所以1.6除以0.3的余数是1；<br />（5）五年级的三好生人数占五年级学生人数的45%，六年级三好生人数占六年级学生人数的55%，五年级的三好生人数比六年级的三好生人数要少．', '4', '[0个, 1个, 2个, 3个]', 'A', '3', '<img align=\"top\" src=\"http://image.yuncelian.com/1/analysis/1cec55af-9d6d-5f19-a5e2-d1767ed2e853.png\" />', '101', null, null, null, null, null, null, null, null, null);
