INSERT INTO `sv_question` VALUES ('c3be2f6a-09a3-11e5-8b03-c81f66fbc0b2', '0', '26', null, null, null, null, '94f9bbcc-06e6-34b6-b738-1978e2fd0043', 'What <fill></fill> things do you want to buy?', '4', '[else, other, others, another]', 'B', '2', 'What else后面不加名词，other后面加名词复数others直接作主语=\"other\" things， another修饰单数名词。句意:你想买其它东西吗？结合语境可知选B。', '101', null, null, null, null, null, null, null, null, null);
INSERT INTO `sv_question` VALUES ('c3befa76-09a3-11e5-b1a3-c81f66fbc0b2', '0', '26', null, null, null, null, '7b7fbc5a-90a3-32c3-8496-d91854231b50', '—What sports is Tony interested in?\n<br/>— <fill></fill><blank></blank>basketball.', '4', '[Play, Plays, Playing, To play]', 'C', '3', '此题考查动名词短语。因此选C。', '101', null, null, null, null, null, null, null, null, null);
INSERT INTO `sv_question` VALUES ('c3c388ac-09a3-11e5-8b03-c81f66fbc0b2', '0', '26', null, null, null, null, '79595f18-341b-3b21-abb4-6b8c0f3669f7', 'Mary is<blank></blank><fill></fill><blank></blank>taller than Tina.', '4', '[a little, a few, a lot of, more]', 'A', '2', 'a little副词短语，一点； a few形容词短语，几个；a lot of许多；more更多。结合语境可知选A。', '101', null, null, null, null, null, null, null, null, null);
INSERT INTO `sv_question` VALUES ('c3c554de-09a3-11e5-8b03-c81f66fbc0b2', '0', '26', null, null, null, null, '213e241c-7476-47da-b48b-8c1943c446e0', 'The teachers never arrive late for work <u>from Monday to Friday</u>.', '4', '[on weekends, on weekdays, every day, five times a week]', 'B', '2', 'on weekends在周末；on weekdays在工作日；every day每天；five times a week一周五次。from Monday to Friday周一到周五，即工作日。', '101', null, null, null, null, null, null, null, null, null);
INSERT INTO `sv_question` VALUES ('c3c6a558-d3f2-369e-a14d-987ceab8693a', '0', '26', null, null, null, null, '79595f18-341b-3b21-abb4-6b8c0f3669f7', 'Jack is good at drawing. I think no one draws <fill></fill>.', '4', '[better, best, worse, worst]', 'A', '3', '略', '101', null, null, null, null, null, null, null, null, null);
INSERT INTO `sv_question` VALUES ('c3c8c100-09a3-11e5-8b03-c81f66fbc0b2', '0', '26', null, null, null, null, 'd65d1108-0fd5-3bba-80b0-c03fc9512b50', '—The earthquake in Ya\'an took place <fill></fill> two past eight <fill></fill> the morning of April 20<sup>th</sup>.\n<br/>—Yes, some people were still sleeping for it was weekend.', '4', '[in ; on, on ; in, at ; in, at ;on]', 'D', '1', '在表示时间时，in 表示在一个时间范围；at 表示在具体时刻；on 表示在具体某一天。 two past eight 是具体几点钟，故前面用介词at。the morning of April 20<sup>th</sup> 是具体的某一天，故用介词on，选D。', '101', null, null, null, null, null, null, null, null, null);
INSERT INTO `sv_question` VALUES ('c3c9488c-09a3-11e5-8b03-c81f66fbc0b2', '0', '26', null, null, null, null, '5e1a8bbb-c035-3a45-9495-4fa4f9bc4fa9', '—Excuse me. Is <fill></fill> e-dictionary yours?\n<br/>—Oh, yes. I am looking for it everywhere. Thank you very much.', '4', '[a, an, the, 不填]', 'C', '1', '句意:——打扰了.这本电子词典是你的吗？——哦，是的。我正在到处找它。非常感谢你。\n<br/>结合语境可知上文特指的是某一本电子词典，故用定冠词，选C。', '101', null, null, null, null, null, null, null, null, null);
INSERT INTO `sv_question` VALUES ('c4023688-09a3-11e5-8b03-c81f66fbc0b2', '0', '26', null, null, null, null, '13226de6-c1d6-40a7-86ec-e1c7e7d5bab9', 'I <fill></fill><blank></blank>a computer.', '4', '[am, have, help, call]', 'B', '2', 'am系动词，是；have有，拥有；help帮助；call喊叫，打电话给；\n<br/>句意：联系上下文，可知本句指的是，我有一台电脑。故选B。', '101', null, null, null, null, null, null, null, null, null);
