INSERT INTO `sv_question` VALUES ('d77aed4a-09a3-11e5-8b03-c81f66fbc0b2', '0', '26', null, null, null, null, '79595f18-341b-3b21-abb4-6b8c0f3669f7', '—There will be <fill></fill> to treat 10 people to lunch.<br/>—Sounds <fill></fill>.', '4', '[enough food; good enough, enough food; enough good, food enough; good enough, food enough; good enough]', 'A', '2', 'enough修饰名词时放在名词前，enough修饰形容词时放在形容词后。故A正确。', '101', null, null, null, null, null, null, null, null, null);
INSERT INTO `sv_question` VALUES ('d7830bf2-a486-4e20-9da4-86798939c23e', '0', '26', null, null, null, null, '23957b95-26ff-4709-8ab7-4ceb1edef3bc', 'She <fill></fill><blank></blank>carefully,<blank></blank>but she <fill></fill> nothing.', '4', '[heard;<blank></blank>listened, listen;<blank></blank>hear, heard;<blank></blank>listened to , listened;<blank></blank>heard]', 'D', '3', 'listen是听的动作，hear是听的结果。', '101', null, null, null, null, null, null, null, null, null);
INSERT INTO `sv_question` VALUES ('d79834cb-32ce-5ba3-9ec6-c7ffebd3468c', '0', '10', null, null, null, null, 'b28b50a1-a272-3cd7-87e0-dacec7903ad3', '下面各式，得数大于1的算式是（　　）', '3', '[0.99×1, 0.8×0.9, 0.9×2]', 'C', '4', '<img align=\"top\" src=\"http://image.yuncelian.com/1/analysis/d79834cb-32ce-5ba3-9ec6-c7ffebd3468c.png\" />', '101', null, null, null, null, null, null, null, null, null);
INSERT INTO `sv_question` VALUES ('d7a6305e-09a3-11e5-8b03-c81f66fbc0b2', '0', '26', null, null, null, null, '7b76ad8c-bd61-3df6-b937-24932cf9d76c,dbea904f-0c71-35a4-8744-aa450d7a9e28', 'It<blank></blank><fill></fill><blank></blank>when I<blank></blank><fill></fill><blank></blank>my homework last night.', '4', '[raining; did, rained; was doing, was raining;<blank></blank>do, rains; was doing]', 'B', '4', '句意：昨晚当我正在做作业时，下雨了。结合语境可知主句描述的是过去发生的动作，故用一般过去时态。从句中描述的是过去某时正在进行的动作，故用过去进行时态。选Ｂ。', '101', null, null, null, null, null, null, null, null, null);
INSERT INTO `sv_question` VALUES ('d7b1eeb6-7620-55a1-bdff-79725035407a', '0', '10', null, null, null, null, '5bc27d4a-2325-3a0a-b028-9ca45aaeb8cd', '一张长24厘米，宽18厘米的长方形纸，要分成大小相等的小正方形，且没有剩余．最少可以分成（　　）', '4', '[12个, 15个, 9个, 6个]', 'A', '3', '<img align=\"top\" src=\"http://image.yuncelian.com/1/analysis/d7b1eeb6-7620-55a1-bdff-79725035407a.png\" />', '101', null, null, null, null, null, null, null, null, null);
INSERT INTO `sv_question` VALUES ('d7b43ee2-09a3-11e5-8b03-c81f66fbc0b2', '0', '26', null, null, null, null, 'fb080df6-5812-448d-8cd8-1d03fcc48b39,96969a51-f271-322e-9f9f-e53383c77338', 'How <fill></fill><blank></blank>you spell it?', '4', '[is, are, am, do]', 'D', '2', '句意：你怎么拼它？do是助动词，帮助spell构成疑问句，故选D。', '101', null, null, null, null, null, null, null, null, null);
INSERT INTO `sv_question` VALUES ('d7b73e9e-09a3-11e5-8b03-c81f66fbc0b2', '0', '26', null, null, null, null, '7713be9e-9cb2-4133-a936-b8f0483d58a1', '—<fill></fill> did you play the piano today?   \n<br/>—For five hours.', '4', '[When, How long, How often, How soon]', 'B', '2', '根据答语可知是询问“多长时间”，所以B正确。when询问“什么时间”，how<blank></blank>often询问“多久一次”，how<blank></blank>soon用于将来时。', '101', null, null, null, null, null, null, null, null, null);
INSERT INTO `sv_question` VALUES ('d7ba7866-09a3-11e5-8b03-c81f66fbc0b2', '0', '26', null, null, null, null, '79595f18-341b-3b21-abb4-6b8c0f3669f7', '—Are you<blank></blank><fill></fill><blank></blank>to go on a trip to Taiwan?<br/>—Yes. But I don\'t have<blank></blank><fill></fill>.', '4', '[free enough; enough money, enough free; enough money, free enough; money enough, enough free; money enough]', 'A', '2', 'enough的意思是足够的，可做形容词和副词，enough用作形容词修饰名词时放在名词之前，用作副词修饰形容词时应放在形容词之后，本句中free是形容词，money是名词，故选A。', '101', null, null, null, null, null, null, null, null, null);
INSERT INTO `sv_question` VALUES ('d7bdebc2-09a3-11e5-8b03-c81f66fbc0b2', '0', '26', null, null, null, null, 'd65d1108-0fd5-3bba-80b0-c03fc9512b50', 'He often helps the poor children<blank></blank><fill></fill><blank></blank>giving the money.', '4', '[with, by, in, to]', 'B', '2', '句意：他经常通过给他们金钱来帮助那些穷孩子。介词短语by+doing sth表示“通过做某事”表示一种方式。固定短语help sb with sth表示帮助某人做某事；help sb to do sth表示帮助某人做某事。故选 B。 ', '101', null, null, null, null, null, null, null, null, null);
INSERT INTO `sv_question` VALUES ('d7c8d082-09a3-11e5-8b03-c81f66fbc0b2', '0', '26', null, null, null, null, '79595f18-341b-3b21-abb4-6b8c0f3669f7', 'My pen is <fill></fill>. ', '4', '[red, a red, the red, red a]', 'A', '2', '在表示颜色的形容词前不加冠词。故选Ａ。', '101', null, null, null, null, null, null, null, null, null);
