INSERT INTO `sv_question` VALUES ('d7df1bc6-09a3-11e5-8b03-c81f66fbc0b2', '0', '26', null, null, null, null, '168513f7-477c-44fc-a04c-9d9621ae7295', 'It\'s very hot outside.  <u>Why don\'t you</u> stay at home?', '4', '[why don\'t, why not, why no, why didn\'t]', 'B', '2', 'why don’t you相当于\"why\" not，意为“为什么不做某事”，故选B。', '101', null, null, null, null, null, null, null, null, null);
