INSERT INTO `sv_question` VALUES ('d851709a-09a3-11e5-8b03-c81f66fbc0b2', '0', '26', null, null, null, null, '885adcf8-65ea-35ff-9ac4-00dcaedf00d8', 'You must remember <fill></fill>.', '4', '[what your teacher said, what did your teacher say, your teacher said what, what has your teacher said]', 'A', '3', '此题是what引导的宾语从句，从句要用陈述句语序。只有A正确。', '101', null, null, null, null, null, null, null, null, null);
INSERT INTO `sv_question` VALUES ('d85b205e-09a3-11e5-8b03-c81f66fbc0b2', '0', '26', null, null, null, null, '5e1a8bbb-c035-3a45-9495-4fa4f9bc4fa9', 'They often take<blank></blank><fill></fill><blank></blank>walk after dinner.', '4', '[a, ∕, the, an]', 'A', '2', '句意：饭后他们经常去散步。短语take a walk去散步，本句中walk用作可数名词，表示一次散步，词首音素是辅音，不定冠词用a，故选A。', '101', null, null, null, null, null, null, null, null, null);
