INSERT INTO `sv_question` VALUES ('da31afe5-9b7b-53c9-b982-5327b6e3bb8b', '0', '20', null, null, null, null, 'ab0f0a0f-da94-37ac-afcc-b190e1f6385c', '<img  src=\"http://image.yuncelian.com/1/2018/1/190fe24ed4cba405266cd7ed8a66c66e.png\" style=\"vertical-align:middle;FLOAT:right;\" />如图，已知二次函数y=ax<SUP>2</SUP>+bx+c（a≠0）的图象与x轴交于点A（-1，0），与y轴的交点B在（0，-2）和（0，-1）之间（不包括这两点），对称轴为直线x=1．下列结论：<br />①abc＞0 <br />②4a+2b+c＞0 <br />③4ac-b<SUP>2</SUP>＜8a <br />④<span class=\"YclQues\" mathtag=\"math\" style=\"whiteSpace:nowrap;wordSpacing:normal;wordWrap:normal\"><table cellpadding=\"-1\" cellspacing=\"-1\" style=\"margin-right:1px\"><tr><td style=\"border-bottom:1px solid black\">1</td></tr><tr><td>3</td></tr></table></span>＜a＜<span class=\"YclQues\" mathtag=\"math\" style=\"whiteSpace:nowrap;wordSpacing:normal;wordWrap:normal\"><table cellpadding=\"-1\" cellspacing=\"-1\" style=\"margin-right:1px\"><tr><td style=\"border-bottom:1px solid black\">2</td></tr><tr><td>3</td></tr></table></span>&nbsp;<br />⑤b＞c．<br />其中含所有正确结论的选项是（　　）', '4', '[①③, ①③④, ②④⑤, ①③④⑤]', 'D', '3', '<img align=\"top\" src=\"http://image.yuncelian.com/1/analysis/da31afe5-9b7b-53c9-b982-5327b6e3bb8b.png\" />', '101', null, null, null, null, null, null, null, null, null);
