INSERT INTO `sv_question` VALUES ('db71e750-09a3-11e5-8b03-c81f66fbc0b2', '0', '26', null, null, null, null, '4fbb8ad5-8bd5-4b28-996a-810f0f0c891b', '<fill></fill> useful advice she gave you!<blank></blank>You should listen to her. ', '4', '[How, How a, What, What a]', 'C', '3', '感叹句公式：\n<br/>what+[a(an)]+adj.+n.+主语+谓语!\n<br/>How+adj./adv.+主语+谓语!\n<br/>advice是不可数名词，其前不能用不定冠词，所以应该将B和D排除；又根据How强调是后面的形容词或副词，而what强调的是名词，根据advice，本题应该选C。', '101', null, null, null, null, null, null, null, null, null);
INSERT INTO `sv_question` VALUES ('db726054-09a3-11e5-8b03-c81f66fbc0b2', '0', '26', null, null, null, null, '885adcf8-65ea-35ff-9ac4-00dcaedf00d8', 'The boy asked his father <fill></fill>. ', '4', '[where it happens, when did it happen, what did it happen, how it happened]', 'D', '3', '根据句子的结构可知本句是一个宾语从句。根据的宾语从句的时态规则“如果主句是过去时，则从句应该用过去时的某种时态。”可知，主句用的过去时，则从句应该使用过去时，所以应该排除A；又根据宾语从句的语序要用陈述句语序可知，应该将BC排除。所以本题选D。', '101', null, null, null, null, null, null, null, null, null);
INSERT INTO `sv_question` VALUES ('db764fd4-09a3-11e5-8b03-c81f66fbc0b2', '0', '26', null, null, null, null, 'a13d80bb-de7f-3975-af6a-d7a400cc7b28', 'This book <fill></fill> Lucy\'s. Look! Her name is on the book cover.', '4', '[must be, may be, can\'t be, mustn\'t be]', 'A', '2', 'must be一定，必须；may be可能是；can\'t be不可能是；没有mustn\'t be 的用法。联系下文，她的名字就在书的封面上。可知这本书一定是Lucy的。故选A。', '101', null, null, null, null, null, null, null, null, null);
