INSERT INTO `sv_question` VALUES ('e20530ea-09a3-11e5-8b03-c81f66fbc0b2', '0', '26', null, null, null, null, 'd65d1108-0fd5-3bba-80b0-c03fc9512b50', '—Write it __________ your book, please.<br/>—S-U-M-M-E-R, summer.', '4', '[on, in, after, /]', 'B', '2', '句意：请把它写在你的书上。 in your book在你的书上，介词用in。故选B。<br/>考点：考查介词。</p><p></p>', '101', null, null, null, null, null, null, null, null, null);
